import { Button, StyleSheet, Text, View, TextInput } from 'react-native';

function ViewClients(params) {
    return (
        <View>
            {
                params.clients.map((c) => <Text key={c.clientName + c.contactEmail}>{c.clientName}</Text>)
            }
        </View>
    )
}

export default ViewClients;
